import React from 'react';  
import { motion } from 'framer-motion';  
import { Mail, Globe, Shield, FileText, ExternalLink } from 'lucide-react';  

const MegaPrivacySection = () => {  
  // Definimos los recursos
  const resources = [
    {
      title: 'Guía de Protección de Datos',
      description: 'Manual completo sobre el manejo seguro de datos personales y corporativos.',
      link: 'https://ejemplo.com/guia-proteccion'
    },
    {
      title: 'Formatos Oficiales',
      description: 'Plantillas y documentos estandarizados para trámites legales.',
      link: 'https://ejemplo.com/formatos'
    },
    {
      title: 'Marco Normativo',
      description: 'Compilación de leyes y reglamentos actualizados.',
      link: 'https://ejemplo.com/normativas'
    },
    {
      title: 'Casos de Estudio',
      description: 'Ejemplos prácticos y resoluciones de casos relacionados.',
      link: 'https://ejemplo.com/casos'
    },
    {
      title: 'Preguntas Frecuentes',
      description: 'Respuestas a dudas comunes sobre normativas y procedimientos.',
      link: 'https://ejemplo.com/faq'
    },
    {
      title: 'Actualizaciones Legales',
      description: 'Últimas modificaciones y nuevas disposiciones normativas.',
      link: 'https://ejemplo.com/updates'
    }
  ];  
  return (  
    <motion.div  
      className="bg-slate-900/50 backdrop-blur-xl rounded-3xl p-10 shadow-2xl border border-purple-500/20 relative overflow-hidden"  
      initial={{ opacity: 0, y: 50 }}  
      animate={{ opacity: 1, y: 0 }}  
      transition={{ duration: 0.8, delay: 0.2 }}  
    >  
      <div className="absolute top-4 left-4 text-purple-400 opacity-80">  
        <Shield className="w-8 h-8" />  
      </div>  
      <div className="relative z-10">  
        <h2 className="text-4xl font-bold text-white mb-8 text-center bg-gradient-to-r from-purple-400 to-pink-500 bg-clip-text text-transparent">  
          Recursos y Documentación  
        </h2>  
        <div className="grid md:grid-cols-2 gap-8 mb-8">  
          <div className="space-y-4">  
            <div className="flex items-center p-4 bg-slate-800/50 rounded-2xl border border-purple-500/20">  
              <Mail className="w-6 h-6 text-purple-400 mr-3" />  
              <div>  
                <strong className="text-white text-lg">Correo Electrónico:</strong>  
                <p className="text-gray-300">consultas@normatecaelite.com</p>  
              </div>  
            </div>  
            <div className="flex items-center p-4 bg-slate-800/50 rounded-2xl border border-purple-500/20">  
              <Globe className="w-6 h-6 text-purple-400 mr-3" />  
              <div>  
                <strong className="text-white text-lg">Sitio Web:</strong>  
                <p className="text-gray-300">www.normatecaelite.com</p>  
              </div>  
            </div>  
          </div>  
          <div className="space-y-4">  
            <div className="flex items-center p-4 bg-slate-800/50 rounded-2xl border border-purple-500/20">  
              <FileText className="w-6 h-6 text-purple-400 mr-3" />  
              <div>  
                <strong className="text-white text-lg">Documentación:</strong>  
                <p className="text-gray-300">Biblioteca de recursos legales</p>  
              </div>  
            </div>  
            <div className="flex items-center p-4 bg-slate-800/50 rounded-2xl border border-purple-500/20">  
              <Shield className="w-6 h-6 text-purple-400 mr-3" />  
              <div>  
                <strong className="text-white text-lg">Recursos Disponibles:</strong>  
                <p className="text-gray-300">Guías, formatos y documentación oficial</p>  
              </div>  
            </div>  
          </div>  
        </div>  
        <motion.div  
          className="mt-8 grid gap-6 md:grid-cols-2 lg:grid-cols-3"  
          variants={container}  
          initial="hidden"  
          animate="show"  
        >  
          {resources.map((resource, index) => (  
            <motion.a  
              key={index}  
              href={resource.link}  
              target="_blank"  
              rel="noopener noreferrer"  
              className="group bg-slate-800/50 p-6 rounded-2xl border border-purple-500/20 hover:border-purple-500/40 transition-all duration-300"  
              variants={item}  
              whileHover={{ scale: 1.02 }}  
            >  
              <h3 className="text-xl font-bold text-purple-400 mb-2">{resource.title}</h3>  
              <p className="text-gray-300 text-sm">{resource.description}</p>  
              <div className="mt-4 flex items-center text-purple-400 group-hover:text-purple-300">  
                <span>Acceder</span>  
                <ExternalLink className="w-4 h-4 ml-2" />  
              </div>  
            </motion.a>  
          ))}  
        </motion.div>  
      </div>  
    </motion.div>  
  );  
};  

const container = {  
  hidden: { opacity: 0 },  
  show: {  
    opacity: 1,  
    transition: {  
      staggerChildren: 0.1  
    }  
  }  
};  

const item = {  
  hidden: { opacity: 0, y: 20 },  
  show: { opacity: 1, y: 0 }  
};  

export default MegaPrivacySection;
